What is the output of the following Java code?
`public class Main{
     public static void main(String []args){
        int x = 10;
        int y = 5;
        int z = (x > y) ? x : y;
        System.out.println(z);
     }
}`

What is the output of the following C++ code?
`#include <iostream>
using namespace std;

int main() {
    int a = 10;
    int b = a++ + ++a;
    cout << b;
    return 0;
}`

What programming concept is demonstrated in the provided code snippet?
`def calculate_factorial(n):
    if n == 0:
        return 1
    else:
        return n * calculate_factorial(n - 1)`

What is the output of the following code snippet: 
`int x = 5; 
int y = x++ + ++x; 
std::cout << y;` ?

What will be the output of the following C++ code?
`#include <iostream>
using namespace std;

int main() {
    int a = 5, b = 10, c = 15;
    int x = (a > b) ? (b > c) ? b : c : (a > c) ? a : c;
    cout << x;
    return 0;
}`

What programming concept is demonstrated in the following Python code snippet?
`class Animal:
    def make_sound(self):
        print("Animal sound")

class Mammal(Animal):
    def has_fur(self):
        print("Has fur")

class Dog(Mammal):
    def bark(self):
        print("Woof!")`
